class Solution:
    def play_shiritori(self, words: List[str]) -> str:
        history = set()

        for word in words:
            if len(word) > 120:
                return "Fair Game"

            history.add(word)

        player_1 = True
        for i in range(2, len(words)):
            word = words[i]
            if len(word) == 1:
                return "Player " + (player_1 + 1) + " lost"
            elif len(word) == 0:
                player_1 = not player_1
            else:
                last_letter = word[-1]
                last_word = words[i-1]
                if not (last_letter in history and last_letter in last_word):
                    return "Player " + (player_1 + 1) + " lost"

        return "Fair Game"

